import React from 'react';
import './Header.css';
import CreateRoomButton from './CreateRoomButton';

export default function Header({ title, test }) {
    return (
        <div id="header">
            HEADER
            {title}
            {test}
            <CreateRoomButton />
        </div>   
    )
}
